import { Chrono } from "react-chrono";
import { BsAlarm } from "react-icons/bs";

function Formation() {
	const items = [
		{
			title: "May 1940",
			cardTitle: "Dunkirk",
			cardSubtitle: "Men of the British Expeditionary Force (BEF) wade out to..",
			cardDetailedText: "Men of the British Expeditionary Force (BEF) wade out to..",
		},
		{
			title: "May 1940",
			cardTitle: <BsAlarm />,
			cardDetailedText: "Men of the British Expeditionary Force (BEF) wade out to..",
		},
		{
			title: "May 1940",
			cardTitle: "Dunkirk",
			cardSubtitle: "Men of the British Expeditionary Force (BEF) wade out to..",
			cardDetailedText: ["Men of the British Expeditionary Force (BEF) wade out to..", <BsAlarm />],
		},
	];

	return (
		<Chrono
			items={items}
			theme={{
				primary: "var(--green-2)",
				secondary: "var(--orange-2)",
				cardBgColor: "transparent",
				cardForeColor: "var(--white)",
				titleColor: "black",
			}}
			mode='VERTICAL'
			borderLessCards
			hideControls
			useReadMore={false}
			onItemSelected={() => {}}
		/>
	);
}

export default Formation;
